import { Link } from "react-router-dom";
import korbous from "../../Images/korbous/korbous.jpg";
import { Image } from "react-bootstrap";

function CardDest(props) {

    let im = props.ima
     const card1 = {im} ;
    // background: ${(props)=>props.color};
    // ';
    return (
        <div class="col-sm-6 col-md-6 col-lg-3 " >
            <Link to="/acceuil" className="mx-4 ">
                <div className="card " style={{backgroundImage: `url(${card1})`}}>
                {/* <img src={require('../../Images/korbous/korbous.jpg')}  fluid/> */}
                
                    <h5>{props.title}</h5>
                    <p>{props.subtitle}</p>
                </div>
                
                
                
            </Link>
            {im}
        </div>
    );
}

export default CardDest;
